      "text": "16. Bey Hrn. Rudolf Ramssperger an der Huthgass ist extra guter Holländer-Taback in bleyernen Pfund-Büchsen à 10 Batzen, wie auch guter St. Vincent à 8 Btz. zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "17. Wo guter Art grosse Bohnen zum Setzen, und kleine weisse dito zum Kochen in billigem Preiss zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "18. Zwey Baretlein oder Professor-Hüth, wie auch ein ganz neuer Castor - Huth, mittelmässiger Grösse, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "19. Bey Hrn. Burkhardt zum Riesen sind extra neue grosse Jtaljänische Feigen, dito grosse Meertrauben mit und ohne Stiel, haselnuss, dürre Morcheln, feiner Chocoladen, alles in billigem Preiss zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "20. Zwölff Säck neuer Waizen in billigem Preiss, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "21. Bey Hrn. Jacob Grimm Buchbinder ist zu haben: Ein Kriegs-Atlas von 65 theils Land-Karten, Städten, Plans von Bataillen und Belagerungen des jetzigen Kriegs. 2) Die Welt in einer Nuss mit Kupfern. 3) Die Durchlauchtige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiegne avec figures."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "22. Zwey saubere frantzösische Bether in ein Wirthshaus auf das Land oder in ein Bad dienlich, ohnentgeldtlich im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "23. Eine Behausung in der Aeschemer Vorstadt mit 4 Stuben, 5 Kammern samt einer grossen Werkstatt, Estrig und einem schönen gewölbten Keller und Garten, weshalb sich bey Hrn. Jacob Mäglin dem Weinmann anzumelden."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "24. Ein Freund, welcher circa 600 Sester hanf-Saamen anhero liefern könnte, möchte aber solchen vorhero verkauft wissen, offeriert selbigen dahero in billigem Preiss, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "25. Wo guter alter weisser Wein zu haben, ist bey Mstr. Michael Fuchs dem Küefer zu vernehmen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "26. Circa 6. Saum extra guter alter pur rother Ydsteiner-Wein, so gut als Neuenburger oder Burgunder, in billigem Preiss, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "27. Zwey Stücklein weissen Wein von 1756. à 8 Pfund 10 s der Saum im einten, und à 8 Pfund im andern, wovon nach Belieben zu haben, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "28. Ein Stock Heu ab 3 Thänen Matten vorm Riechemer-Thor oberhalb der Schorenbrück. Ferner ein Stücklein von 17 Saumen rothen Hölltger-Wein von 1760. schön roth und lauter, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "29. Auf E. E. Zunft zum Bären sind wiederum neue Saure Rüben in billigem Preiss zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "30. Ein roth Scharlachen Camisol und Hosen in billigem Preiss, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "31. Im Offenburger-hof ist wohlverwährter Bau zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "32. Ein Brennhäusslein bey der Steinen-Mühlin mit aller Kommlichkeit, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "33. Bey weme rother und weisser Burgunder, wie auch Muscat-Wein, Bienenweiss wegen Mangel Platzes, wie auch roth und weisser 1753ger Margräfer-Wein in billigem Preiss zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "34. Feine heitergelbe hamburger-Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweis zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "35. Herren Hofzach des Steigriffs Behausung im Spieg-lgässlein mit 4 Stuben, 3 Kammern 2c. ist entweder zu verkaufen, oder kamethaft zu verleihen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "36. Weisse und rothe Margräfer-Weine von 1760. wovon in billigem Preiss nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "37. Ein Mannensitz in St. Peters Kirch auf dem Letner. Jtem ein grün Tombeau-Bethlein mit grünen wollenen Umhängen, in billigem Preiss, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "38. Ein Hausschlitten mit einem schönen Bild und Zugehördt in billigem Preiss, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "39. Der Bärenfelser-hof zu St. Peter, mit Garten, Stallung, Keller 2c. wie der Augenschein zeigen wird. In Ermanglung eines Käufers"
